public void dfs(TreeNode root, String path, Listres) {
    if (root == null) return;
    if (root.left == null && root.right == null) {
        res.add(path + root.val);
        return;
    }
    path += root.val + "->";
    dfs(root.left, path, res);
    dfs(root.right, path, res);
}

