public TreeNode insertIntoBST(TreeNode root, int val) {
    TreeNode node = new TreeNode(val),
                cur = root;
    while (cur != null) {
        if (cur.val > val) {
            if (cur.left != null) {
                cur = cur.left;
            } else {
                cur.left = node;
                break;
            }
        } else {
            if (cur.right != null) {
                cur = cur.right;
            } else {
                cur.right = node;
                break;
            }
        }
    }
    return root;
}

